import React, {useEffect, useState} from 'react';
import { Chart } from "react-google-charts";

import './home.css';
import { axiosService } from '../../service/axios';

function Home() {

    const [options, setOptions] = useState({
        title: 'Gráfico de Pizza'
    })
    const [data, setData] = useState([
        ['Linguagens', 'Quantidade'],
        ['React', 100],
        ['Angula', 80],
        ['Vue', 50],
    ])
    
    useEffect(() => {
        loadDashProductValue();
    },[])

    async function loadDashProductValue() {
        axiosService({
            method:'GET',
            url:'/recycling/mktProductValue',
            params:{
                page:0,
                size:5
            }
        }).then(response => {
            let values = [];
            console.log(response.data.listRecyclingProductsValue);
            response.data.listRecyclingProductsValue.map((p) => {
                console.log((p.averageValue));
            })
            console.log(values);
        }).catch(error => {

        })
    }
        
    return(
        <div id='containerPage'>
            <div id='containerResultFind'>
                
                    <Chart
                        // width='50%'
                        // height='50%'
                        chartType="Bar"
                        data={data}
                        options={options, {
                            chartArea: { width: '50%' },
                            title: 'Density of Precious Metals, in g/cm^3',
                            width: '200px',
                            height: '200px',
                            bar: { groupWidth: '100%' },
                            legend: { position: 'none' },
                            colors: ['#2B4748', '#DDDF4B'],
                            // legend: { width: '10%' },
                            // isStacked: true,
                        }}
                    />
                
            </div>
        </div>
    )
    
}
export default Home;
